function buscarCodigo() {
            // Pega o valor digitado no input e remove espa칞os extras
            const nomeDigitado = document.getElementById('inputMunicipio').value.trim();
            
            // Elemento onde o resultado ser치 exibido
            const resultadoDiv = document.getElementById('resultado');
            
            if (nomeDigitado === "") {
                resultadoDiv.innerHTML = '游뚿 Por favor, **digite o nome** de um munic칤pio para buscar.';
                return;
            }

            // Normaliza o nome digitado para a busca (min칰sculas)
            const nomeBusca = nomeDigitado.toLowerCase();

            // 1. Usa o m칠todo find() para buscar o primeiro objeto que corresponde ao crit칠rio.
            // A busca 칠 feita de forma flex칤vel (case-insensitive)
            const municipioEncontrado = codMunicipos.find(municipio => 
                municipio["Nome_Munic칤pio"].toLowerCase() === nomeBusca
            );

            // 2. Verifica se um munic칤pio foi encontrado
            if (municipioEncontrado) {
                const codigo = municipioEncontrado["C칩digo Munic칤pio Completo"];
                const nome = municipioEncontrado["Nome_Munic칤pio"];
                const uf = municipioEncontrado["Nome_UF"];
                
                resultadoDiv.innerHTML = `

                    **C칩digo do Munic칤pio (IBGE):** <span class="codigo-encontrado">${codigo}</span>
                `;
            } else {
                resultadoDiv.innerHTML = `
                    仇 **Munic칤pio N칚o Encontrado.**<br>
                    N칚o foi poss칤vel encontrar o munic칤pio **"${nomeDigitado}"** na sua lista de dados.
